import logo from '../asserts/globalnav_apple_image__b5er5ngrzxqq_large.svg'


const srcNav = [
    1,
    2,
    3, 
    4
]

function Nav(){
    const ListeNav = srcNav.map((element) => 
    <li key={element.toString()} src={element}></li>
    )
    return (
        <ul className="nav">{ListeNav}</ul>
    )
}

export default Nav
